import '../../CSS/index.css'
import image from "../MainPage/Background1.jpeg";
import React from "@types/react";


function Listings() {
    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <br/>
            <div style={{position: 'relative'}}>
                <div style={{textAlign: 'center', position: 'absolute', paddingLeft: '35%',bottom: '35%',paddingRight: '10%'}}>
                    <section id={"listings"}>
                        <h1 style={{fontSize: '6vh', fontFamily: 'Newslab, georgia, Bakersville', color: '#01426A'}}>Available Listings</h1>
                    </section>
                </div><img src={image} alt="Nothing" style={{width: '1440px', height: '755px', filter: 'brightness(50%)', boxShadow: '1px 12px 9px #6f6f6f'}}/>
            </div>
            <div className="separator" />
        </>
    );
}

export default Listings;
